import Typing from 'react-typing-animation'

const Index = () => (
    <div className='grid'>
        <div className='header'>
            <Typing>
                <div>
                    <Typing.Delay ms={50} />
                    For CS students, by CS students.
                </div>
            </Typing>
        </div>
        <style jsx>{`
        .header {
            font-size: 40px;
            font-weight: 700;
            line-height: 1.2;
            color: #486491;
            margin: 20px auto;
            font-family: 'Arial';
        }
        .grid {
            display: grid;
            grid-template-columns:70% 30%;
        }
      `}</style>
    </div>

);

export default Index;
